    test();
  };

  const Germania = () => {
    console.log('O parte cod cod este "2 + 2 * 2" ');
    test();
  };

  const Anglia = () => {
    console.log('O parte cod cod este "12312312312312 / 2" ');
    test();
  };

  const Rusia = () => {
    console.log('O parte cod cod este "23 * 9" ');
    test();
  };

